        return(<div>
            <h1>Date Of Birth</h1>
            <User6 DOB="2-7-1993">Ram</User6>
            <User6 DOB="11-4-2000">Sham</User6>
            <User6 DOB="7-1-1998">Jhon</User6>
            <User6 DOB="28-9-2006">Mark</User6>
        </div>);
    }
}
export default User5;
